import React from 'react';
c


function Assignments(props) {

  
  const handleLogout = () => {    
    props.history.push('/login');
  }

  return (
    <div>
      Welcome User!<br /><br />
      Upload Answer Sheet.
      <input type="file" name="img" /> 
      <input type="button" onClick={handleLogout} value="Logout" />
    </div>
  );
}

export default Assignments;
